//--------------------------------------------------------------------------------------//
//                                       Projects.js                                       //
//--------------------------------------------------------------------------------------//


import React from 'react';
import Slideshow from '../Slideshow/Slideshow';
import DarkModeToggle from '../DarkModeToggle/DarkModeToggle';
import './Projects.css'; 
import personal_project1 from '../images/project_thumbnails/maplestory_app_cropped.gif';
import personal_project2 from '../images/project_thumbnails/invaded_space_cropped.gif';
import personal_project3 from '../images/project_thumbnails/bullseye_cropped.png';


// slides to use for slideshow picture
const personal_projects_slides = [
  {
    image: personal_project1,
    caption: 'Making Maplestory w/ Flutter',
  },
  {
    image: personal_project2,
    caption: 'Invaded Space',
  },
  {
    image: personal_project3,
    caption: 'Bullseye',
  },
];


function Projects() {
  return (
    <div className="projects">
      <h1>About Us</h1>
      <section class="projects__hackathons">
        <div class="projects__slideshow-container">
          <Slideshow slides={personal_projects_slides} />
        </div>
      </section>
      <section class="projects_personal">
        <div className="projects__slideshow-container">
          <Slideshow slides={personal_projects_slides} />
        </div>
      </section>
      <div className="projects__slideshow-container">
        <Slideshow slides={personal_projects_slides} />
      </div>
      {/* ...other content */}
    </div>
  );
}

export default Projects;
